<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <link rel="icon" href="%PUBLIC_URL%/favicon.ico" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta name="theme-color" content="#000000" />
    <meta
      name="description"
      content="Web site created using create-react-app"
    />
    <link rel="preload" as="image" href="Tech.webp" type="image/webp" srcset="Tech.webp"/>
    <link rel="preload" as="image" href="Sheet.webp" type="image/webp" srcset="Sheet.webp"/>
    <link rel="preload" as="image" href="Musicality.webp" type="image/webp" srcset="Musicality.webp"/>
    <img src='Tech.webp' style=" display: none;" alt="Tech" />
    <img src='Sheet.webp' style=" display: none;" alt="Sheet" />
    <img src='Musicality.webp' style=" display: none;" alt="Musicality" />
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Aboreto&family=Belleza&family=Cormorant+SC:wght@700&family=Poppins:ital,wght@0,100;0,200;0,400;1,100&family=Tangerine:wght@700&display=swap" rel="stylesheet">
    <!--
      manifest.json provides metadata used when your web app is installed on a
      user's mobile device or desktop. See https://developers.google.com/web/fundamentals/web-app-manifest/
    -->
    <link rel="manifest" href="%PUBLIC_URL%/manifest.json" />
    <!--
      Notice the use of %PUBLIC_URL% in the tags above.
      It will be replaced with the URL of the `public` folder during the build.
      Only files inside the `public` folder can be referenced from the HTML.

      Unlike "/favicon.ico" or "favicon.ico", "%PUBLIC_URL%/favicon.ico" will
      work correctly both with client-side routing and a non-root public URL.
      Learn how to configure a non-root public URL by running `npm run build`.
    -->
    <title>React App</title>
  </head>
  <body>
    <noscript>You need to enable JavaScript to run this app.</noscript>
    <div id="root"></div>
  </body>
</html>
